import React from "react"
import Data from "./Data"
import './index.css'

function Prodact(){

   

    const arr=Data.map((el)=>{
        return(
          <div className="CardList" key={el.id}>
            <img src={el.image} alt="" />
            <h1>{el.title}</h1>
            <p>{el.description}</p>
           
            <button onClick={()=> <p>{(el.price)}</p>}>To Find Out the Price</button>
         
            </div>
        )
    })
    return(
<div className="List">
    {arr}
</div>
    )
}
export default Prodact
